import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Sddiagnostic } from 'src/app/models/Sddiagnostic';

@Injectable({
  providedIn: 'root'
})
export class SddiagnosticService {
  private apiUrl = 'https://localhost:7129/SDiagnostic';

  constructor(private http: HttpClient) {}

  createSdiagnostics(sddiagnostic: Sddiagnostic): Observable<HttpResponse<any>> {
    return this.http.post<any>(`${this.apiUrl}/createSdiagnostics`, sddiagnostic, { observe: 'response' });
  }
